  return (
    <div>
      <ReactPlayer
        url="https://www.youtube.com/watch?v=q3xy4p2JTfU"
        width="100%"
        height="100%"
        muted={true}
        playing={false}
        loop={false}
      />
    </div>
  );
};

export default Player;
